INSERT INTO weekly_horoscope(zodiac_sign, week_of_year, "text")
VALUES ('Aries', '2023-14',
        'As abundant, lucky Jupiter finishes its last full month in Aries, it’s time to double down on your personal goals. You won’t want to squander one second of this clarifying month because after May 16, Jupiter won’t be back in your sign for another decade!');
INSERT INTO weekly_horoscope(zodiac_sign, week_of_year, "text")
VALUES ('Gemini', '2023-14',
        'Sort through your squad and the people you spend the most time with: Do they elevate or irritate you? Do they share your vision for life? It might be time to give a few seats to members who are aligned with your mission. As for the ones that irk you? Well, maybe a few of them are mirroring some of your own not-so-savory traits—or maybe they’re messengers who are there to help you grow.');
